			'blogger'     => '#f57d00',
			'wallet'      => '',
			'vk'          => '#4c75a3',
			'dribble'     => '#ea4c89',
			'wordpress'   => '#21759b',
			'google'      => '#4285f4',
			'rss'         => '#ff6600',
			'lastfm'      => '#d51007',
			'yelp'        => '#af0606',
			'twitch'      => '#6441a5',
			'vimeo'       => '#1ab7ea',
			'spotify'     => '#1ed760',
			'github'      => '#181717',
			'angellist'   => '#000',
			'amazon'      => '#ff9900',
			'viber'       => '#665cac',
			'android'     => '#a4c639',
			'quora'       => '#b92b27',
		);

		$keys_to_keep = array_flip( $social_media ); // Flip the values to keys

		$icons = self::get_cozy_icon_collection();

		$result = array_intersect_key( $icons, $keys_to_keep );

		foreach ( $result as $key => $value ) {
			if ( is_string( $result[ $key ] ) ) {
				// $result[ $key ] = array( $value, $default_colors[ $key ] );
				$result[ $key ] = array_merge( array( 'logo' => $value ), array( 'defaultColor' => $default_colors[ $key ] ) );

			}
		}
		// print_r( $result );

		return $result;
	}

